import React, { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { searchByNameAction, fetchConsistencyNamesAction } from '../redux/actions/action';
import { TextField, Box, Typography, FormControl, Select, MenuItem, Grid } from '@mui/material';
import VoterTable from './VoterTable';
import AllDataComponent from './AllDataComponent';
import CastedDataComponent from './CastedDataComponent';
import NotCastedDataComponent from './NotCastedDataComponent';
import { Icon } from "@iconify/react";
import Autocomplete from '@mui/material/Autocomplete';

const LeadData = () => {
  const dispatch = useDispatch();
  const [searchName, setSearchName] = useState('');
  const searchData = useSelector((state) => state.searchByNameReducer?.data || []);
  const constituencyNames = useSelector((state) => state.constituencyNames || []); // Assuming state.constituencyNames holds the constituency names array
  const [constituency, setConstituency] = useState('');
  const [section, setSection] = useState('all');
  const [filteredSearchData, setFilteredSearchData] = useState([]);

  useEffect(() => {
    dispatch(fetchConsistencyNamesAction(constituency));
  }, [constituency, dispatch]);

  useEffect(() => {
    if (section === 'all') {
      setFilteredSearchData(searchData);
    } else if (section === 'casted') {
      setFilteredSearchData(searchData.filter(voter => voter.casted));
    } else if (section === 'not-casted') {
      setFilteredSearchData(searchData.filter(voter => !voter.casted));
    }
  }, [section, searchData]);

  const handleInputChange = (event, newValue) => {
    setSearchName(newValue); // Update state with the selected value or what's typed in the input
    dispatch(searchByNameAction(newValue)); // Dispatch action based on the selected value or what's typed in the input
  };

  const handleSectionChange = (event) => {
    const value = event.target.value;
    setSection(value);
  };

  return (
    <Box sx={{ padding: 4 }}>
      <Grid container sx={{ padding: 3, display: 'flex', justifyContent: 'space-between' }}>
        <Grid item>
          <Box sx={{ boxShadow: '0px 0px 3px #888888', borderRadius: '7px', backgroundColor: "white", padding: '2px 5px' }}>
            <Autocomplete
              disablePortal
              id="combo-box-demo"
              options={constituencyNames}
              getOptionLabel={(option) => option.name} // Assuming 'name' is the property you want to display
              sx={{ width: 300 }}
              value={searchName}
              onChange={handleInputChange}
              renderInput={(params) => <TextField {...params} label="Movie" />}
            />
          </Box>
        </Grid>

        <Grid item>
          <FormControl size="small" sx={{ boxShadow: '0px 0px 3px #888888', borderRadius: '7px', backgroundColor: "white", padding: '2px 5px', "& .MuiOutlinedInput-root": {
            "&.Mui-focused .MuiOutlinedInput-notchedOutline": {
              borderColor: "transparent",
            },
            "&:hover .MuiOutlinedInput-notchedOutline": {
              borderColor: "transparent",
            },
            "& .MuiOutlinedInput-notchedOutline": {
              borderColor: "transparent",
            }
          } }}>
            <Select value={section} onChange={handleSectionChange}>
              <MenuItem value="all">All Voters</MenuItem>
              <MenuItem value="casted">Casted Votes</MenuItem>
              <MenuItem value="not-casted">Not Casted Votes</MenuItem>
            </Select>
          </FormControl>
        </Grid>
      </Grid>

      {searchName.trim() !== '' ? (
        filteredSearchData.length === 0 ? (
          <Typography variant="h6" sx={{ marginTop: 2 }}>
            No data available
          </Typography>
        ) : (
          <VoterTable voters={filteredSearchData} />
        )
      ) : (
        <>
          {section === 'all' && <AllDataComponent />}
          {section === 'casted' && <CastedDataComponent />}
          {section === 'not-casted' && <NotCastedDataComponent />}
        </>
      )}
    </Box>
  );
};

export default LeadData;
